import React from 'react';

const Card = ({ name, description, id }) => {
    return (
        <div className='bg-washed-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='pink cotton candy' src={`https://robohash.org/${id}?150x150`} />
            <div>
                <h2>{ name }</h2>
                <p>{ description }</p>
            </div>
        </div>
    );
}

export default Card;
